import React from 'react'

function Button(props) {

    const {value,className, onClick, isClicked} = props

    const handleClick =()=>{

        isClicked(value,className)

    }
    return (
        <button value={value} className ={className} onClick={handleClick}>
            {value}
        </button>
    )
}

export default Button
